Quiabo  para evitar câimbras musculares
Nome científico: Abelmoschus esculentus (sinônimo: Hibiscus esculentus) 
Família: Malváceas 
A falta de magnésio no organismo pode trazer sintomas desagradáveis para o indivíduo como: o Quiabo e rico em magnésio, 
a falta de magnésio pode provocar alterações do sistema nervoso como depressão, tremores e insônia;
insuficiência cardíaca;
osteoporose;
pressão alta;
diabetes mellitus;
tensão pré menstrual - TPM;
insônia;
cãimbras;
falta de apetite;
sonolência;
falta de memória.
O quiabo é ótimo para evitar câimbras musculares, manter um bom funcionamento dos músculos, nervos e densidade óssea, aliviar contusões, antioxidante, cicatrizante e melhora o  sistema imunológico promovendo uma maior resistência às infecções.

