Rowland type C engine, a 2 stroke with a check ball by pass valve in the piston. It has dual exhausts & there's no throttle on the carb. The engine is water cooled by the copper tank, the greenish glass tank is the fuel/oil mix.  Will run as a hit & miss or a throttler engine. Still have a couple bugs to get out of it. 

